import React from "react";

import Layout from "../components/Layout";

const Home = () => {
  return (
    <React.Fragment>
      <Layout>
        <header>
          <div className="title-box">
            <h1 className={"title-text"}>L.H.M</h1>
          </div>
        </header>
      </Layout>
    </React.Fragment>
  );
};

export default Home;
